CREATE TABLE IF NOT EXISTS REDFOX_POKEMON (
    `id` NUMERIC(4, 1) NOT NULL,
    `name` VARCHAR(27) CHARACTER SET UTF8MB4,
    `pokedex_number` NUMERIC(4, 1),
    `img_name` VARCHAR(11) CHARACTER SET UTF8MB4,
    `generation` NUMERIC(2, 1),
    `evolution_stage` VARCHAR(7) CHARACTER SET UTF8MB4,
    `evolved` NUMERIC(2, 1),
    `family_id` NUMERIC(4, 1),
    `cross_gen` NUMERIC(2, 1),
    `type_1` VARCHAR(8) CHARACTER SET UTF8MB4,
    `type_2` VARCHAR(8) CHARACTER SET UTF8MB4,
    `weather_1` VARCHAR(13) CHARACTER SET UTF8MB4,
    `weather_2` VARCHAR(13) CHARACTER SET UTF8MB4,
    `stat_total` NUMERIC(4, 1),
    `atk` NUMERIC(4, 1),
    `def` NUMERIC(4, 1),
    `sta` NUMERIC(4, 1),
    `legendary` NUMERIC(2, 1),
    `aquireable` NUMERIC(2, 1),
    `spawns` NUMERIC(2, 1),
    `regional` NUMERIC(2, 1),
    `raidable` NUMERIC(2, 1),
    `hatchable` NUMERIC(3, 1),
    `shiny` NUMERIC(2, 1),
    `nest` NUMERIC(2, 1),
    `new` NUMERIC(2, 1),
    `not_gettable` NUMERIC(2, 1),
    `future_evolve` NUMERIC(2, 1),
    `100%cp@40` NUMERIC(5, 1),
    `100%cp@39` NUMERIC(5, 1)
);

